它们用于拼接标识符。 与 format! 类似， format_ident! 具有以下功能，比如： 除了 {} 插值，还支持位置参数和命名参数插值，如 format_ident!("{0}", arg) 和 format_ident!("{arg}", arg) 支持一些有限的 格式化 的方式： {} ⇒ 按照 IdentFragment 格式化 {:o} ⇒ Octal 八进制格式化 {:x} ⇒ LowerHex 小写字母格式化 {:X} ⇒ UpperHex 大写字母格式化 {:b} ⇒ Binary 二进制格式化 let num: u32 = 10; let decimal = format_ident!("Id_{}", num);
assert_eq!(decimal, "Id_10"); let octal = format_ident!("Id_{:o}", num);
assert_eq!(octal, "Id_12"); let binary = format_ident!("Id_{:b}", num);
assert_eq!(binary, "Id_1010"); let lower_hex = format_ident!("Id_{:x}", num);
assert_eq!(lower_hex, "Id_a"); let upper_hex = format_ident!("Id_{:X}", num);
assert_eq!(upper_hex, "Id_A"); 但它也与 format! 不同，因为： format! 使用 Display 方式格式化 {}，而 format_ident! 使用 IdentFragment，而 IdentFragment trait 只对有限的类型实现，比如无符号整数和字符串 Ident 参数如果存在 r# 前缀的话，会把 r# 去除掉（由 IdentFragment 提供的） format_ident! 的结果为 Ident 类型，而不是 String 类型。Ident 与任何实现 AsRef<str> 的类型 可以比较相等 标识符 Ident 类型表示 Rust 代码的一个 字，可能是关键字或合法的变量名。标识符至少由一个 Unicode 代码点组成，其中第一个代码点具有 XID_Start 属性，其余代码点具有 XID_Continue 属性。注意： 空字符串 "" 不是标识符，应该使用 Option<Ident> 表示它。 生命周期不是标识符，应该使用 syn::Lifetime。 除了使用 quote::format_ident!，你还可以直接使用 proc_macro2 或者 syn [2] 里的 Ident::new(&str, Span::call_site()) 构造任意 Rust 标识符（包括关键字）。但 format_ident! 与后者方式的区别在于，format_ident! 可以构造出原生字符串 r#。 在解析标识符时： syn::parse 可以解析 Rust 关键字之外的标识符。 通过 input.call(syn::Ident::parse_any) 方式可以达到解析任意标识符（包括关键字）的目的。 通过 input.call(syn::Ident::unraw) 方式可以达到去除 r# 前缀的目的。 proc_macro2::Ident 、 proc_macro::Ident 和 syn::Ident 都定义了类似的数据结构。 从 Ident::new 的签名中，可以看到，构造标识符需要提供第二个参数 Span ，它表示源代码的区域范围，意味着标识符在某个范围内的“卫生性”。 format_ident! 在这方面有如下说明： 最后创建的标识符使用第一个 Ident 参数的范围 // 如果 `ident` 是一个被解析的标识符，那么这段的 `my_ident` 会继承 ident 的范围
let my_ident = format_ident!("My{}{}", ident, "IsCool");
assert_eq!(my_ident, "MyIdentIsCool"); 当无标识符可提供时，默认调用 Span::call_site 表示当前过程宏被调用的范围 format_ident!("MyIdent") 也可以使用 span = 指定范围 let my_span = /* ... */;
format_ident!("MyIdent", span = my_span);

