quote! 是整个 quote crate 提供的最主要的功能： 该宏进行变量插值：任何实现了 ToTokens trait 的类型都能插值 宏的结果为 proc_macro2::TokenStream 类型：如果要返回给编译器（即作为过程宏的输出），则使用 .into() 或者 proc_macro::TokenStream::from 把它转化为 proc_macro::TokenStream 类型 一个 derive 过程宏的代码框架： use proc_macro::TokenStream;
use quote::quote;
use syn::{parse_macro_input, DeriveInput}; #[proc_macro_derive(MyMacro)]
pub fn my_macro(input: TokenStream) -> TokenStream { // Parse the input tokens into a syntax tree let input = parse_macro_input!(input as DeriveInput); // Build the output, possibly using quasi-quotation let expanded = quote! { // ... }; // Hand the output tokens back to the compiler TokenStream::from(expanded)
} 函数内的代码就是我们编写过程宏的主体，完成了过程宏的第 2 步：处理和生成标记流。具体来说： syn::parse_macro_input! 把获取到的标记流转化成实现了 syn::parse::Parse 的类型 然后基于 syn 丰富的数据结构，处理标记流 利用 quote::quote! 把标记流重组成 proc_macro2::TokenStream，其间可把实现了 quote::ToTokens 的数据插值 最后把 proc_macro2::TokenStream 转化成 proc_macro::TokenStream [4] ，它们之间实现了 双向转化 这一步很好理解，因为过程宏的函数签名只有 proc_macro::TokenStream。此外，一个基本事实是，忽略 unicode-xid 依赖，proc_macro2 对 proc_macro 进行了包装，quote 基于和拓展了 proc_macro2 的功能，而 syn 基于和拓展了 quote 与 proc_macro2。

