quote! 使用 #var 语法插值，这类似于 macro_rules! 的 $var 插值方式。这里说的“插值”，具体指：把当前作用域里的变量 var 插入到输出标记的某处。 具体能插入哪些东西呢？或者说如何控制插入的标记的含义呢？ 与声明宏使用 13 种分类片段符 ( fragment specifiers ) 进行解析和生成标记的做法不同，过程宏使用了不同的方式 [5] ：使用 syn::parse 解析标记，并使用 quote::ToTokens trait 生成标记。 任何实现了 ToTokens 的类型都能通过 quote! 插值，而且至少有以下类型： 在 quote::ToTokens 实现了的 Rust 大部分的原始类型：各种数值、常用字符串、bool、Option、Box、Rc 等 在 quote::ToTokens 实现了的 proc_macro2 的主要类型：Group、Ident、Punct、Literal、TokenTree、TokenStream syn 内定义的 大部分类型 事实上，quote! 自身是一个声明宏，而且只以 tt 分类符的方式匹配任意多的标记，其背后也大量使用声明宏。 与声明宏的 反复替换 功能类似，quote! 也支持反复插值，但有以下特点： 反复插值其实是在迭代每个元素时，给每个元素插入一份重复体的代码副本 var 可以是任意满足 Iterator 和 ToTokens 要求 [6] 的类型：比如 Vec、BTreeSet、实现了 Iterator::Item: ToTokens 的迭代器类型 语法（例子）： #(#var)* #(#var),* ⇒ 每一项之间用 , 分隔 #( struct #var; )*、#( + #var; )* ⇒ 可以包含其他标记 #( #k => println!("{}", #v), )* ⇒ 一次包含多个插值 // lib.rs
use quote::quote;
use proc_macro::TokenStream; #[proc_macro]
pub fn test(_: TokenStream) -> TokenStream { let range = 1..4; let q = quote!( 0 #(+ #range)*); println!("{}", q); // 0 + 1i32 + 2i32 + 3i32 dbg!(q).into() // q = TokenStream [ ... ]
} // main.rs
fn main() { let q = path_to::test!(); dbg!(q); // q = 6
} 这里的实现细节有些复杂，感兴趣的话见 源码 。一个特例是 Vec，它没有实现 ToTokens，但它依然可用于反复插值。

