quote 和 syn 是好搭档，你可以在 syn 的 examples 下找到实操的综合例子 你可以把最终生成的 proc_macro2::TokenStream 拆成多个部分，即利用插值把局部标记组合起来，比如： let type_definition = quote! {...};
let methods = quote! {...}; let tokens = quote! { #type_definition #methods
}; 把构造标识符的步骤放到 quote! 之前： // 错误做法：在 `quote!` 内部构造标识符并不会把各部分标识符拼接起来
// `_` 和 `ident` 代表的标识符不会组合成一个，如果 `ident` 代表 `x`，那么这如同 `_ x` quote! { let mut _#ident = 0; } // 正确做法：在 `quote!` 内只保存 `#var` 语法，就如同引用一样 （quasi-quoting）
let varname = format_ident!("_{}", ident);
quote! { let mut #varname = 0; } // 正确做法
let concatenated = format!("_{}", ident);
let varname = syn::Ident::new(&concatenated, ident.span());
quote! { let mut #varname = 0; } 调用方法时，尤其是泛型方法，使用 <Type>::func() 语法插值，如： // 错误做法：虽然这有时可以生效（比如 `field_type` 是 `String`）
// 但如果 `field_type` 是 `Vec<i32>`，那么这种方法如同手写的 `Vec<i32>::new()`
// 而正确写法应为 `Vec::<i32>::new()` 或者 `<Vec<i32>>::new()`
// 即使为 `String`，这种 `<String>::new()` 语法实际也是正确的
quote! { let value = #field_type::new(); } // 正确做法
quote! { let value = <#field_type>::new(); } // 正确做法
quote! { let value = <#field_type as core::default::Default>::default(); } 在文档注释中插值： // 错误做法：这不会把 `#ident` 的值插入进来
quote! { /// try to interpolate: #ident /// /// ...
} // 错误做法：这不会把 `#ident` 的值插入进来
quote! { #[doc = "try to interpolate: #ident"] } // 错误做法：`#[doc]` 属性在 `quote!` 中不支持调用宏（比如这里的 `stringify!` 以及 `include_str!`）
quote! { #[doc = concat!("try to interpolate: ", stringify!(#ident))] } // 正确做法：把需要插入的值（甚至那所涉及的部分）放入变量，使用 `#[doc = #msg]` 语法插值
let msg = format!(...);
quote! { #[doc = #msg] /// /// 其他无需插值的注释内容...
} 使用 syn::Index 对元组或者元组结构体索引插值： // 错误做法
let i = 0usize..self.fields.len();
// 以下代码会展开成不正确的语法 `0 + self.0usize.heap_size() + self.1usize.heap_size() + ...` quote! { 0 #( + self.#i.heap_size() )* } // 正确做法
let i = (0..self.fields.len()).map(syn::Index::from);
// 以下代码展开成正确的语法 `0 + self.0.heap_size() + self.1.heap_size() + ...`
quote! { 0 #( + self.#i.heap_size() )* }

