这个宏充当过程宏的解析入口：无论哪种过程宏，也无论转化成 syn 定义的语法树还是你自定义的语法树，几乎都从这个宏开始。 一个最基本的 derive 宏的完整例子是： #// Cargo.toml 中写入以下内容：
#// [dependencies]
#// syn = "1.0"
#// quote = "1.0"
#// #// [lib]
#// proc-macro = true use proc_macro::TokenStream; #[proc_macro_derive(MyMacro)]
pub fn my_macro(input: TokenStream) -> TokenStream { // Parse the input tokens into a syntax tree let input = syn::parse_macro_input!(input as syn::DeriveInput); TokenStream::new()
} 当你使用 cargo expand --lib 命令，可以看到如下结果（点击右上角的取消隐藏看到完整内容）： ##![feature(prelude_import)]
##[prelude_import]
#use std::prelude::rust_2021::*;
##[macro_use]
#extern crate std; use proc_macro::TokenStream;
#[proc_macro_derive(MyMacro)]
pub fn my_macro(input: TokenStream) -> TokenStream { let input = match ::syn::parse_macro_input::parse::<syn::DeriveInput>(input) { ::syn::__private::Ok(data) => data, ::syn::__private::Err(err) => { return ::syn::__private::TokenStream::from(err.to_compile_error()); } }; TokenStream::new()
} #const _: () = {
# extern crate proc_macro;
# #[rustc_proc_macro_decls]
# #[allow(deprecated)]
# static _DECLS: &[proc_macro::bridge::client::ProcMacro] =
# &[proc_macro::bridge::client::ProcMacro::custom_derive(
# "MyMacro",
# &[],
# my_macro,
# )];
#}; 尽管以下内容不完全与 parse_macro_input! 有关，但是为了深入这段展开的代码，你需要确切地掌握以下内容，并且注意一些事情。 卫生性 涉及 prelude 的几行，以及 #[macro_use] extern crate std; 是每个 rs 文件都会自动添加的内容，它们用于导入最常用的 items，和 std 的 所有公开的声明宏 。由此，你可以直接使用 Option、Result（以及它们的成员）这些数据结构与 traits，而不必使用绝对路径或者手动 use。而 println! 这类常见的宏，以及你可能不会经常使用的宏（比如 compile_error! ），也会被加载进来。 了解这一点很重要，因为过程宏 不是卫生的 ： 时刻警醒自己，不要轻易假设使用者的句法上下文，以免让意外的重名标识符污染代码，尽可能在 生成的标记中 使用 绝对路径 、或者添加醒目的标识前后缀 —— 使用 ::std::result::Result 而不是 Result，对生成的 内部函数名或内部变量名 使用 __internal_foo 而不是 foo。 宏展开 parse_macro_input! 被展开成以下 match 语句： let input = match ::syn::parse_macro_input::parse::<syn::DeriveInput>(input) { ::syn::__private::Ok(data) => data, ::syn::__private::Err(err) => { return ::syn::__private::TokenStream::from(err.to_compile_error()); }
}; 它是个声明宏，所做的事情很简单，解析成功则取出数据，解析失败则直接返回错误。 它有两种语法： ($tokenstream:ident as $ty:ty) 或者 ($tokenstream:ident)：即把实现 Parse trait 的类型放到宏的语法内，或者放到模式语法上 let input = syn::parse_macro_input!(input as syn::DeriveInput);
let input: syn::DeriveInput = syn::parse_macro_input!(input); // 或者在 binding 时指明类型 ($tokenstream:ident with $parser:path)：使用具有 Parser trait 的类型，这个 trait 专门为函数而设计， 函数签名满足 FnOnce(ParseStream) -> Result<T> 即可。 此外，你肯定会好奇这里的 syn::__private 模块，它没什么特别的，里面是 std、quote、proc_macro2、proc_macro 和 syn 其他模块的 reexport，这印证了第一点的建议：在宏中使用绝对路径。 你还需要观察到以下三点： ::syn::parse_macro_input::parse 这个内部函数与 syn::parse 函数几乎别无二致，都把 proc_macro::TokenStream 转化成 实现了 Parse trait 的类型。但它们的唯一的区别在于， ::syn::parse_macro_input::parse 增加支持解析 AttributeArgs ，此类型用在解析属性宏参数上。 Err(err) 中的 err 是 syn::parse::Error 类型，也是 syn::Error 类型。因为这两个 Error 类型都是从 syn::error 私有模块的重导出。 syn::Result 和 syn::parse::Result 也是同一类型，因为它们是类型别名 + 重导出。 这个宏使用的另一个限制条件：必须用在返回值为 proc_macro::TokenStream 类型的函数中。 const _ 技巧 最后的 const _ 部分是过程宏库自动添加的，它用于 初始化 过程宏。 这是一种不起眼的语法，你很少真正手写它，但它却是宏非常常用的技巧。它有正式的名称 —— unnamed const ，具有很好的性质：可以重复定义。 无论是过程宏还是声明宏，你都会感受到这种写法给你提供便利：在只能定义 item 的地方，它给你一个编译期求值的局部作用域，在其中你可以给某个类型实现 trait，而且可以定义不影响源代码的临时 const 或 type alias 或数据结构。 在 proc-macro-workshop 的最后一个案例 bitfield 中，你势必会使用这种技巧。比如 这样 或者 这样 。

