Parse 是 syn 里对外用途最广泛的 trait （之一，另一个对外被广泛使用的 trait 是 quote::ToTokens ）。 它很简单，因为只有一个方法： pub trait Parse: Sized { fn parse(input: ParseStream<'_>) -> Result<Self>;
} syn 根模块中（syn::*）的大多数结构体和枚举体都实现了此 trait，其功能就是把语法标记的缓冲流解析成语法树。 一个典型的使用方法如下： #// src: https://docs.rs/syn/latest/syn/parse/index.html#example
#use syn::{
# braced,
# parse::{Parse, ParseStream},
# punctuated::Punctuated,
# token, Field, Ident, Result, Token,
#};
struct ItemStruct { struct_token: Token![struct], ident: Ident, brace_token: token::Brace, fields: Punctuated<Field, Token![,]>,
} impl Parse for ItemStruct { fn parse(input: ParseStream) -> Result<Self> { let content; Ok(ItemStruct { struct_token: input.parse()?, ident: input.parse()?, brace_token: braced!(content in input), fields: content.parse_terminated(Field::parse_named)?, }) }
} 这是 syn::ItemStruct 实现 Parse 的一个简要版本，你只需要使用 input.parse()? 就能解析一个语法标记。这得益于 Rust 的泛型和 syn 给你写好的基础解析类型及其 Parse 实现。 这段样例代码不难看懂，但里面的细节得琢磨琢磨。 Token! 和 braced! 这里涉及两个宏：Token! 和 braced!，其中 braced! 与 bracketed! 和 parenthesized! 用法一致。 使用 cargo expand 展开得到： struct ItemStruct { struct_token: ::syn::token::Struct, ident: Ident, brace_token: token::Brace, fields: Punctuated<Field, ::syn::token::Comma>,
} impl Parse for ItemStruct { fn parse(input: ParseStream) -> Result<Self> { let content; Ok(ItemStruct { struct_token: input.parse()?, ident: input.parse()?, brace_token: match ::syn::group::parse_braces(&input) { ::syn::__private::Ok(braces) => { content = braces.content; braces.token } ::syn::__private::Err(error) => { return ::syn::__private::Err(error); } }, fields: content.parse_terminated(Field::parse_named)?, }) }
} syn::Token! 声明宏做的事情非常简单，把标点或者关键字直接替换成 syn::token 模块下对应的解析类型： 把 Token![struct] 替换成 ::syn::token::Struct，把 Token![,] 替换成 ::syn::token::Comma。任何需要写出 syn::token::xx 的地方，都可以使用这个宏，而无需记住其类型名称。 作者为了展示这个功能“特别”的宏，特意使用了大写，以及方括号 []。 syn::braced! 声明宏与 syn::parse_macro_input! 类似 ，被展开成 match 语句来处理 Result。但它需要一个预先声明的 content 变量，当 content 经过 braced! 处理之后，为 ParseStream 类型，用于解析花括号 {} 内部的标记（如这里的 fields）。 而 bracketed! 和 parenthesized! 也是一样的用法，区别在于后两者用在解析方括号 [] 和圆括号 () 上。 接下来，把目光放到主角 ParseStream 类型上。 ParseBuffer 与 ParseStream ParseStream 是 ParseBuffer 的共享引用的类型别名： type ParseStream<'a> = &'a ParseBuffer<'a>; 我们总是在 syn 的解析函数的函数签名中把 ParseStream 作为函数参数，而在解析函数内部，调用其方法时，应该参考 ParseBuffer 的文档。 此外，ParseStream 是共享引用，它实现了 Copy trait：任何使用它的地方，都是使用引用的复制品，而不具有移动语义。 ParseBuffer 表示缓冲标记流的游标位置，其背后的核心类型是 Cursor （后面会谈到这个类型）。 你无法在 syn 之外的代码构造 ParseBuffer，只通过三条公开的解析入口接触到此类型： parse_macro_input! 用于解析过程宏的输入； syn::parse* 函数用于中途解析语法； Parser trait 用于抽象所有解析函数。 它的文档非常友好，这里只概括地浏览一遍： 位置 方法名 返回值类型 [1] 说明 推进 parse(&self) Result<T> 成功解析当前游标下的语法标记之后，把游标位置推进到下一个标记 推进 call(&self, f) Result<T> 与 parse 方法类似，但使用一个解析函数 f 不变 peek(&self, t) bool 判断下一个标记是否是 t 不变 peek2(&self, t) bool 判断下下一个标记是否是 t 不变 peek3(&self, t) bool 判断下下下一个标记是否是 t 不变 lookahead1(&self) Lookahead1 可调用 .peek() 判断下一个标记是否是一组标记中的某一个，如果不是，可调用 .error() 方法来返回解析错误 不变 fork(&self) Self 不建议使用；其实质是将 Self 复制（游标的复制成本很低），但需要注意解析成本；此方法可搭配 Speculative trait 不变 is_empty(&self) bool 判断解析流是否还有待解析的标记 不变 span(&self) Span 如果解析流导了末尾（无待解析的标记），返回 Span::call_site() （过程宏在源码的位置）；否则返回当前游标下（即下一个标记）的 Span 不变 error(&self, message) syn::Error 在当前游标位置上返回错误信息 不变 cursor(&self) Cursor 底层的解析 API；复制当前游标位置，对其返回的游标做任何操作都不会影响解析流的游标 结束 parse_terminated(&self, f) Result<Punctuated<T, P>> 从当前游标解析直到解析流的末尾，解析成 0 次或多次 T，每个 T 的分隔符为 P，且最后的分隔符可以出现也可以不出现 推进 step(&self, f) Result<R> 强大但底层的解析 API，但在 syn 之外很少使用（因为你很少直接使用 Cursor）：f 类似于 fn(Cursor) -> Result<(R, Cursor)> 形式即可；解析成功将自动推进游标 T 和 P 都为实现了 Parse 的类型，即 T: Parse、P: Parse；R 可为任意类型。 你可以观察到，这些方法都只有 &self，而没有 &mut self，而推进游标理应需要独占引用。这是因为 ParseBuffer 采用了“内部可变性”设计，其背后