在 Rust 的类型系统中，使用 trait 进行抽象是最根本的方式： pub trait Component<Params, Content> { fn call(&self, ui: &mut Ui, params: Params, content: Content);
} 这里的关键在于，使用Params 泛型参数来抽象 comp* 函数中这些 a, b, c, ... 函数参数。 然后，给函数实现 Component （以简单的两参数为例）： impl<F, P1, P2, Content> Component<(P1, P2), Content> for F
where P1: PartialEq + Clone + 'static, P2: PartialEq + Clone + 'static, Content: FnOnce(&mut Ui), F: Fn(&mut Ui, P1, P2, Content),
{ fn call(&self, ui: &mut Ui, params: (P1, P2), content: Content) { let (p1, p2) = params; self(ui, p1, p2, content) }
} 这个 where 语句表达了最核心的内容： 原本的泛型参数 Params 被“规定成”某种严格/具体一些的形式：(P1, P2)。(P1, P2) 依然是一种泛型，表示使用者应传入两元素的元组。 F: Fn(&mut Ui, P1, P2, Content)：这把所考虑的回调函数的形式抽象出来了。 P1、P2、Content 的 trait bounds 不是本文的重点，无需赘言。 // https://play.rust-lang.org/?version=nightly&mode=debug&edition=2021&gist=820a56b25ce4cfef20795e0b111f7cc5
#![allow(unused)] #pub struct Ui {}
#impl Ui {
# pub fn update<T>(&mut self, a: String, b: Vec<T>, f: impl FnOnce(&mut Ui))
# where T: PartialEq + Clone + 'static {
# }
#}
#
#pub trait Component<Params, Content> {
# fn call(&self, ui: &mut Ui, params: Params, content: Content);
#}
#
#impl<F, P1, P2, Content> Component<(P1, P2), Content> for F
# where P1: PartialEq + Clone + 'static,
# P2: PartialEq + Clone + 'static,
# Content: FnOnce(&mut Ui),
# F: Fn(&mut Ui, P1, P2, Content)
#{
# fn call(&self, ui: &mut Ui, params: (P1, P2), content: Content) {
# let (p1, p2) = params;
# self(ui, p1, p2, content)
# }
#}
#
pub fn memoize<Params: PartialEq + Clone + 'static, Content: FnOnce(&mut Ui), Comp: Component<Params, Content>>( ui: &mut Ui, component: Comp, params: Params, content: Content) { component.call(ui, params, content);
} fn comp2(ui: &mut Ui, a: u8, b: u32, f: impl FnOnce(&mut Ui)) { f(ui); } fn main() { let mut ui = Ui {}; memoize(&mut ui, comp2, (2, 3), |_| {}); let args = (String::new(), vec![(1usize, 1.0f64)]); memoize(&mut ui, Ui::update, args, |_| {});
} 至此，memoize 支持任何具有 F: Fn(&mut Ui, P1, P2, Content) 形式的函数（方法、甚至闭包），只要其参数满足各自的 trait bounds。 如何支持其他参数长度的函数 F: Fn(&mut Ui, ..., Content) 呢？ 很简单，却也很无聊，只需继续实现 impl<F, ..., Content> Component<(...), Content> for F —— 整个过程只运用了最基础的 trait bounds 知识。

