// 实际上，由于 `P: 'static`，a 必须是 &'static str， b 必须是 Vec<'static str>
memoize(&mut ui, comp_, ("", vec![""]), |_| {}); // ok let s = String::from(""); // 生命周期不是 'static
memoize(&mut ui, comp_, (&s, vec![&s]), |_| {}); // error[E0597]: `s` does not live long enough 当你 去掉 'static 约束 ，memoize 接受上面的代码。 如果你不明白 T: 'static 意味着什么，请仔细阅读 Common Rust Lifetime Misconceptions

