本文内容整理自： https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342 如果你定义一个这样的枚举体： #[derive(Debug)]
enum Foo { Bar(u32), Bink(u32),
} 这是一种 data-carrying 的枚举体，而且它特殊在： variants 中携带你所关心的 u32 类型的数据； 这个类型位于 tuple variant 在第一个位置上。 从而它们 (variants) 形式上同质：相同的类型位于相同的位置。 那么，为了获取到 u32 数据，通常我们采用模式匹配的方式取出数据，而且对于枚举体，最常用 match 匹配： // src: https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342/2
impl Foo { fn get_value(&self) -> u32 { match self { Bar(value) => *value, Bink(value) => *value, } }
} 而 @CKalt 提出一个很有启发性的观点： It would be nice, if, when all the variants of an enum share an identical type, that there were a way to refer to that data by it's position instead of having to pull it would with some long match statement, etc... 当所有 variants 都有相同的类型时，是否可能有一种方式，按照位置引用/访问数据，而不是只能写很长的匹配语句。 习惯上把 variant 类比 struct，因为它们都有：常规型、元组型、unit 型。 而元组结构体可以直接通过 .number_of_position 语法访问数据，那么在同质形式的 variants 中也使用这种语法，是不是更方便呢： let bink = Foo::Bink(20);
println!("bink num = {}", bink.0); 当然，这种同质形式的 variants 很少见，因为很多时候，一个枚举体里的各个 variant 形态各异：可能携带数据也可能不携带数据，而且即便携带数据，其数量、类型、位置都不一定相同。 可是这个问题并不算无趣，将思维拓展之后，会发现这是一个值得学习的案例（当然不仅仅是学习 variant）。

