在 Rust 1.53 版本中，模式匹配有了一种新模式叫： or-patterns ，其一般阐述见 reference#or-patterns 。 当所有 variants 都是元组型，而且第一个位置都是相同类型，那么你可以这样写： // src: https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342/6
enum Foo { Bar(u32, u32, f64), Bink(u32, f64),
} fn demo(x: Foo) { use Foo::*; let (Bar(num, ..) | Bink(num, _)) = x; println!("{}", num);
} fn main() { demo(Foo::Bink(0, 1.));
} 类似地，当所有 variants 都是常规结构体型，而且相同类型的字段名一致，那么你可以这样写： enum Foo { Bar {x: u32, y: u32, z: f64}, Bink {x: u32, y: f64},
} fn demo(foo: Foo) { use Foo::*; // 这个 `()` 叫分组模式 (Grouped Pattern) 用于显式控制复合模式的优先级 // 在多种模式表达不清的时候，用它来明确优先级 let (Bar {x, ..} | Bink {x, ..}) = foo; println!("{}", x);
} fn main() { demo(Foo::Bink {x: 0, y: 1.});
} 即便相同类型的字段名不一致，你依然可以利用强大的模式匹配： enum Foo { Bar {xx: u32, y: u32, z: f64}, Bink{x: u32, y: f64},
} fn demo(foo: Foo) { use Foo::*; let (Bar {xx: x, z, ..} | Bink {x, y: z, ..}) = foo; println!("{} {}", x, z);
} fn main() { demo(Foo::Bink {x: 0, y: 1.2});
}

