在宏的 13 种分类片段符 (Fragment Specifiers) 里，专门有一种来匹配模式： pat 。在思路二中，我们一直在谈论模式匹配，所以这是引导我们考虑编写宏的起点。 从最简单的例子出发： #[derive(Debug)]
enum Foo { Bar(u32), Bink(u32),
} 把 (Bar(n) | Bink(n)) 部分用宏进行替换： //! src: https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342/9
//! author: https://users.rust-lang.org/u/steffahn
macro_rules! Foo { ($p:pat) => { Foo::Bar($p) | Foo::Bink($p) }
} fn main() { let x = Foo::Bar(42); let Foo!(n) = x; // 即 let (Bar(n) | Bink(n)) = x; println!("{}", n);
} 由思路二可以知道，当 variants 是元组长度不一时或者常规结构体型时，我们都可以使用模式匹配语法轻松处理掉。 //! src: https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342/9
//! author: https://users.rust-lang.org/u/steffahn
#[derive(Debug)]
enum Baz { Variant1 { x: u32, y: String, z: bool, }, Variant2 { x: u32, z: bool, qux: fn(), }
} macro_rules! Baz { ($($field:ident $(: $p:pat)?,)* ..) => { Baz::Variant1{ $($field $(: $p)?,)* .. } | Baz::Variant2{ $($field $(: $p)?,)* .. } }
} fn main() { let baz = Baz::Variant1 { x: 42, y: "hello".into(), z: false }; let Baz!{ x, z, .. } = &baz; println!("{:?} with `x` being {:?} and `z` being {:?}", baz, x, z);
} 这里有一些细节： 所有 item 的声明顺序与使用顺序无关；但宏不是 item，宏必须在使用之前声明。 Foo! 和 Baz! 可适用于以下两种模式： 解构 ( destructuring )：把值分解成其组成部分，所以 let Foo!(n) = x; 让 n 为 u32 类型。 以 ref 方式绑定：以非引用模式匹配引用时，绑定方式 ( binding mode ) 会自动变为 ref 或 ref mut（详细说明见 RFC: match ergonomics ）。所以 let Baz!{ x, z, .. } = &baz; 中的 x 和 z 分别是 &u32 和 &bool 类型。 正如 Rust By Example 的 macros 一章提到的宏的优点：减少重复；自定义语法；可变长度的参数。虽然无法拥有 Foo::Bink(20).0 或者 Baz::Variant1 { x: 42, y: "hello".into(), z: false }.x 直接访问的语法，但我们依然可以通过宏和模式进行创造。

