当有很多类似 Baz 的枚举体时，我们可以用宏来生成同名宏 Baz!。 //! src: https://users.rust-lang.org/t/generic-referencing-enum-inner-data/66342/9
//! author: https://users.rust-lang.org/u/steffahn
#![allow(unused)] macro_rules! define_enum_macro { ($Type:ident, $($variant:ident),+ $(,)?) => { define_enum_macro!{#internal, [$], $Type, $($variant),+} }; (#internal, [$dollar:tt], $Type:ident, $($variant:ident),+) => { macro_rules! $Type { ($dollar($field:ident $dollar(: $p:pat)?,)* ..) => { $($Type::$variant { $dollar($field $dollar(: $p)?,)* .. } )|+ } } };
} // -------------------------------------------------------------------------- // #[derive(Debug)]
enum Baz { Variant1 { x: u32, y: String, z: bool, }, Variant2 { x: u32, z: bool, qux: fn(), }
} define_enum_macro!(Baz, Variant1, Variant2); fn main() { let baz = Baz::Variant1 { x: 42, y: "hello".into(), z: false }; let Baz!{ z, .. } = &baz; println!("{:?} with `z` being {:?}", x, z);
} 一些理解/解释： 这里编写了两条解析规则：第一次解析的目的是匹配用户输入的语法，取出所需的 fragment specifiers；第二次解析后真正生成宏。 这里编写了一条内用规则 ( internal rules )，主要原因是：生成宏需要 $ 符号，而它无法直接在 transcriber（指 => 之后的部分）表示出来，因此通过递归，把 $ 符号作为 tt 分类符（用于匹配 tokens tree） 传给下一次解析。而 #internal 被视为内用规则的名称，你可以取任何名字，也可以使用其他前缀符号（比如常见的 @internal_name）。 结语： 通过本篇文章，你可以感受到 Rust 的模式 ( patterns ) 无处不在，见识了它与宏完美结合的典范。 如果你觉得这篇文章有用，请给 steffahn 的 回答 一个点赞以示鼓励。我只是对一则 Rust User Forum 的帖子进行了梳理、记录和补充，没有 steffahn 的回答，也就没有这篇文章。 Rust User Forum 是学习 Rust 和体验 Rust 圈氛围的好地方，每次逛都可以学到许多额外的技巧与收获。一些高质量的回答淹没在茫茫帖子中，这是可惜的，或许以文章/笔记的方式，让更多人看见，这会是一种不错的尝试。

