const 在 Rust 中是一个关键字，而且总是围绕着常量表达式 ( constant expressions ) 和编译期求值等话题。 而论及泛型参数 ( generic parameters )，我们总是想到 trait bounds 和生命周期。或者有时候，我们完全没注意到“泛型参数”这个描述。 我们知道，函数参数是列在函数名之后的 (...) 内的部分，而泛型参数是列在 <...> 内的部分。 泛型参数分为三类： 生命周期参数 类型参数 常量参数 而且它们的顺序被规定为：生命周期必须放置于后两类之前，后两类可以交叉摆放。 对于用途最广泛的类型参数，常常利用 trait bounds 来限制实现，比如以下代码虽然声明一个泛型 T， 但只对 T: Clone 的情况实现功能。 struct Item<T>(T); impl<T: Clone> Item<T> { fn clone_myself(&self) -> Self { Item(self.0.clone()) }
} 而常量参数通常是具体类型，目前仅允许一些基本类型 u8、u16、u32、u64、u128、usize、i8、i16、i32、i64、i128、isize、char、bool 作为常量参数。 比如对于 struct Item<const I: i32>，如果我们需要对 I == 0 和 I != 0 两种情况做不同的实现，该怎么做呢？ struct Item<const I: i32>; // 当然不是以下做法，因为 Rust 不支持
impl<const I: i32> Item<I> where I == 0 {}
impl<const I: i32> Item<I> where I != 0 {}

