常量泛型参数 ( const generics parameters )： 可以在任何 常量条目 中使用，而且只能独立使用，通常作为某类型的参数出现。 作为一种常量上下文 (const context)，只与常量表达式和常量函数共存，无法与普通表达式一起使用。 除非是单路径（单个标识符）或 literal，它必须使用 { ... } 块表达式的形式。 在单态化之后计算值，这与关联常量 ( associated constants ) 类似。 “单态化”在常量泛型参数中是一个基本视角，这意味着对于 Item<const I: i32>，单态化之后的 Item<I = 0> 和 Item<I = 1> 被认为是两个完全不同的类型。 而且 trait bounds 并不会考虑常量泛型参数值的穷尽，Reference 给了以下一个例子： struct Foo<const B: bool>;
trait Bar {}
impl Bar for Foo<true> {}
impl Bar for Foo<false> {} fn needs_bar(_: impl Bar) {}
fn generic<const B: bool>() { let v = Foo::<B>; needs_bar(v); // ERROR: trait bound `Foo<B>: Bar` is not satisfied
} 你可以尝试一下只实现 impl<const B: bool> Bar for Foo<B> {} 会发生什么。 （答案：代码通过。） 从错误报告，我们可以知道，这里的 Foo<B>、Foo<true> 和 Foo<false> 对 trait bounds 来说是完全不同的。

