属性宏是附加到 items 的 属性 。 定义方式： 使用公有函数 pub fn 声明，函数名为属性名 函数带有 #[proc_macro_attribute] 属性 函数签名为 (TokenStream, TokenStream) -> TokenStream。第一个参数表示属性名之后的（括号分隔的）标记树， 如果属性名之后无标记，第一个参数则为空。第二个参数表示该属性之后的内容（包括 items 和其他属性）。 返回值表示用于替换原 item 的 item （可以任意多）。 MWE（接着上面的例子）： //! src/lib.rs // 函数式、derive 式代码不变，追加以下内容 /// 属性式：`#[show_streams]` 或者 `#[show_streams(attr)]`
#[proc_macro_attribute]
pub fn show_streams(attr: TokenStream, item: TokenStream) -> TokenStream { println!("attr: \"{}\"", attr.to_string()); println!("item: \"{}\"", item.to_string()); item
} //! src/main.rs // 追加以下内容 // Example: Basic function
#[show_streams]
fn invoke1() {}
// out: attr: ""
// out: item: "fn invoke1() { }" // Example: Attribute with input
#[show_streams(bar)]
fn invoke2() {}
// out: attr: "bar"
// out: item: "fn invoke2() {}" // Example: Multple tokens in the input
#[show_streams(multiple => tokens)]
fn invoke3() {}
// out: attr: "multiple => tokens"
// out: item: "fn invoke3() {}" // Example:
#[show_streams { delimiters }]
fn invoke4() {}
// out: attr: "delimiters"
// out: item: "fn invoke4() {}"
